counter = 0
CSV.foreach(target) do |row|
  counter += 1
  type = row[2]
  name = nil
  email1 = nil
  email2 = nil
  if type == "exec"
  	name = row[0]
  else
  	name = row[0].split(" ")[0]
  end
  if row[1].include?(",")
  	email1 = row[1].split(",").first
  	email2 = row[1].split(",").last
  else
  	email1 = row[1]
  end
  if type == "exec"
  	code = exec_codes[counter]
  else
  	code = rez_codes[counter]
  end
  if !email2
  	UserMailer.invite_email(email1, name, code).deliver
    p "email1"
  else
  	UserMailer.invite_email(email1, name, code).deliver
    p "email1"
  	UserMailer.invite_email(email2, name, code).deliver
    p "email2"
  end
end

